import React from 'react';
import { useLanguage } from './LanguageContext';

export default function Hero({ contactRef, setPage, token, setAuthInitial, showGetStarted, openTutorial, onDismiss }) {
  const { t, language } = useLanguage();
  
  const handlePrimary = () => {
    // If user is logged-in and this is the first time, open the tutorial
    if (token && showGetStarted) {
      if (openTutorial) openTutorial();
      return;
    }

    // Otherwise behave like before: unauthenticated -> open register; authenticated -> go to app
    if (!token) {
      if (setAuthInitial) setAuthInitial('register');
      setPage('home');
      return;
    }
    setPage('home');
  };

  const handleSecondary = () => setPage('about');

  const features = language === 'ar' ? [
    { icon: '๐ฏ', title: 'ุชุชุจุน ูููู', desc: 'ุชุงุจุน ุนุงุฏุงุชู ููููุงู ุจุณูููุฉ ูุจุณุงุทุฉ' },
    { icon: '๐', title: 'ุฅุญุตุงุฆูุงุช', desc: 'ุดุงูุฏ ุชูุฏูู ูู ุฎูุงู ุงูุฅุญุตุงุฆูุงุช ุงูููุตูุฉ' },
    { icon: '๐', title: 'ุดุงุฑุงุช ุงูุฅูุฌุงุฒ', desc: 'ุงุญุตู ุนูู ุดุงุฑุงุช ุนูุฏ ุชุญููู ุฃูุฏุงูู' },
    { icon: '๐', title: 'ุญูุงูุฉ ุงูุจูุงูุงุช', desc: 'ุจูุงูุงุชู ุขููุฉ ููุญููุฉ ุจุงููุงูู' },
    { icon: '๐', title: 'ุงููุถุน ุงูุฏุงูู', desc: 'ุฑุงุญุฉ ููุนูู ูุน ุงููุถุน ุงููููู' },
    { icon: '๐', title: 'ูุชุนุฏุฏ ุงููุบุงุช', desc: 'ูุฏุนู ุงูุนุฑุจูุฉ ูุงูุฅูุฌููุฒูุฉ' },
  ] : [
    { icon: '๐ฏ', title: 'Daily Tracking', desc: 'Track your habits daily with ease' },
    { icon: '๐', title: 'Statistics', desc: 'View your progress with detailed stats' },
    { icon: '๐', title: 'Achievement Badges', desc: 'Earn badges when you reach your goals' },
    { icon: '๐', title: 'Data Protection', desc: 'Your data is completely safe and secure' },
    { icon: '๐', title: 'Dark Mode', desc: 'Easy on the eyes with night mode' },
    { icon: '๐', title: 'Multi-language', desc: 'Supports Arabic and English' },
  ];

  return (
    <section className="hero-section">
      <div className="hero-inner">
        <div className="hero-copy">
          {onDismiss && (
            <button className="hero-dismiss" onClick={onDismiss} title={t('hideSection')} aria-label={t('hideSection')}>โ</button>
          )}
          <h1>{t('heroTitle')}</h1>
          <p className="hero-sub">{t('heroSub')}</p>
          <div className="hero-ctas">
            {showGetStarted && (
              <button className="hero-cta-primary" onClick={handlePrimary}>{t('getStarted')}</button>
            )}
            <button className="hero-cta-secondary" onClick={handleSecondary}>{t('learnMore')}</button>
          </div>
        </div>
        <div className="hero-visual">
          <div className="card-sample">
            <div className="card-title">{t('todayRoutine')}</div>
            <ul className="card-list">
              <li>{t('morningMeditation')}</li>
              <li>{t('read20Pages')}</li>
              <li>{t('exercise20Min')}</li>
            </ul>
          </div>
        </div>
      </div>
      
      {/* Features Section */}
      <div className="features-section">
        <h2 className="features-title">{language === 'ar' ? 'ูููุฒุงุช ุงูุชุทุจูู' : 'App Features'}</h2>
        <div className="features-grid">
          {features.map((f, idx) => (
            <div key={idx} className="feature-card">
              <span className="feature-icon">{f.icon}</span>
              <h3 className="feature-title">{f.title}</h3>
              <p className="feature-desc">{f.desc}</p>
            </div>
          ))}
        </div>
      </div>
    </section>
  );
}
